import React, { useEffect } from 'react';

// import Config from './config.json';

import style from './style.module.scss';

const App = () => {
  useEffect(() => {
    fetch('./config.json')
      .then(response => response.stringify())
      .then(data => console.log(data));
  }, []);
  return (
    <div className={style.main}>
      ToDo list
    </div>
  );
};

export default App;
